import React from 'react'
import styled from 'styled-components'
import ThumbUpOutlinedIcon from "@mui/icons-material/ThumbUpOutlined";
import ThumbDownOffAltOutlinedIcon from "@mui/icons-material/ThumbDownOffAltOutlined";
import ReplyOutlinedIcon from "@mui/icons-material/ReplyOutlined";
import AddTaskOutlinedIcon from "@mui/icons-material/AddTaskOutlined";
import Card from "../components/Card";
import Comments from '../components/Comments';
import { useDispatch, useSelector } from 'react-redux';

const Container = styled.div`
display:flex;
gap:24px;
`;
const Content = styled.div`
flex:4.5;

`;

const VideoWrapper = styled.div`
`;

const Title = styled.h1`
  font-size: 18px;
  font-weight: 400;
  margin-top: 20px;
  margin-bottom: 10px;
  color: ${({ theme }) => theme.text};
`;

const Details = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
`;

const Info = styled.span`
  color: ${({ theme }) => theme.textSoft};
`;

const Buttons = styled.div`
  display: flex;
  gap: 20px;
  color: ${({ theme }) => theme.text};
`;


const Button = styled.div`
  display: flex;
  align-items: center;
  gap: 5px;
  cursor: pointer;
`;

const Hr = styled.hr`
  margin: 15px 0px;
  border: 0.5px solid ${({ theme }) => theme.soft};
`;

const Recom = styled.div`
flex:2.5;
`;

const Channel = styled.div`
  display: flex;
  justify-content: space-between;
`;

const ChannelInfo = styled.div`
  display: flex;
  gap: 20px;
`;

const Image = styled.img`
width: 50px;
height: 50px;
border-radius: 50%;
`;
const ChangeDetail = styled.div`
display: flex;
flex-direction: column;
color: ${({ theme }) => theme.text};
`;
const ChangeName = styled.span`
font-weight: 500;
`;
const ChangeCounter = styled.span`
margin-top:5px;
margin-bottom:20px;
color: ${({theme})=> theme.textSoft};
font-size: 12px;
`;

const Desc = styled.p`
font-size: 14px;
`;

const Subscrip = styled.button`
background-color:#cc1a00;
font-weight:500;
color:white;
border:none;
border-radius:3px;
height:max-content;
padding:10px 20px;
cursor:pointer
`;


export default function Video() {

  const { currentUser } = useSelector(state => state.user)
  const dispatch = useDispatch()

  
  return (
    <Container>
      <Content>
        <VideoWrapper>
        <iframe
              width="100%"
              height="460"
              src="https://www.youtube.com/embed/k3Vfj-e1Ma4"
              title="YouTube video player"
              frameborder="0"
              allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
              allowfullscreen
            ></iframe>
        </VideoWrapper>
        <Title>Tetst Veideo</Title>
        <Details>
          <Info>15555555 Views</Info>
          <Buttons>
          <Button>
              <ThumbUpOutlinedIcon /> 123
            </Button>
            <Button>
              <ThumbDownOffAltOutlinedIcon /> Dislike
            </Button>
            <Button>
              <ReplyOutlinedIcon /> Share
            </Button>
            <Button>
              <AddTaskOutlinedIcon /> Save
            </Button>
          </Buttons>
        </Details>
        <Hr />
        <Channel>
          <ChannelInfo>
            <Image src='https://assets-prd.ignimgs.com/2022/02/08/toppokemongamesofalltime-blogroll-1644358512665.jpg' />
            <ChangeDetail>
              <ChangeName>WING</ChangeName>
              <ChangeCounter>200 subc</ChangeCounter>
              <Desc>Lorem ipsum dolor, sit amet consectetur adipisicing elit.
                Doloribus laborum delectus unde quaerat dolore culpa sit aliquam
                at. Vitae facere ipsum totam ratione exercitationem. Suscipit
                animi accusantium dolores ipsam ut.</Desc>
            </ChangeDetail>
          </ChannelInfo>
          <Subscrip>BSUB</Subscrip>
        </Channel>
        <Hr />
        <Comments />
      </Content>
      <Recom>
        <Card type="sm"/>
        <Card type="sm"/>
        <Card type="sm"/>
        <Card type="sm"/>
        <Card type="sm"/>
        <Card type="sm"/>
        <Card type="sm"/>
        <Card type="sm"/>
        <Card type="sm"/>
        <Card type="sm"/>
        <Card type="sm"/>
        <Card type="sm"/>
        <Card type="sm"/>
        <Card type="sm"/>
        <Card type="sm"/>
        <Card type="sm"/>
        <Card type="sm"/>
        <Card type="sm"/>
        <Card type="sm"/>
      </Recom>
    </Container>
  )
}
